(1, 'AS100', 'Plan de hasta 100M2', 15, 29000, 1, '<p>Este es el primer plan que he publicado para probar el administrador de productos, es una prueba para ver si se pueden publicar bien</p>', 10, 29000, 'plan', '', '100a400-1.jpg', '', '', ''),
(2, 'AS10002', 'Plan de hasta 100M2 N2', 15, 29990, 1, '<p><strong>Lorem Ipsum</strong>&nbsp;es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno est&aacute;ndar de las industrias desde el a&ntilde;o 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido us&oacute; una galer&iacute;a de textos y los mezcl&oacute; de tal manera que logr&oacute; hacer un libro de textos especimen. No s&oacute;lo sobrevivi&oacute; 500 a&ntilde;os, sino que tambien ingres&oacute; como texto de relleno en documentos electr&oacute;nicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creaci&oacute;n de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y m&aacute;s recientemente con software de autoedici&oacute;n, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum</p>', 20, 29990, 'plan', '', '', '', '', ''),
(7, 'POPP05181', 'Poster | isee N1 70x40', 14, 21990, 1, '<p><strong>ISEE&nbsp;</strong>&iquest;Que tan profunda puede ser una mirada?, &iquest;C&oacute;mo describir en una sola imagen la lealtad peluda?. Siempre es bueno tener presente el amor perruno en el hogar, te invitamos a integrar una imagen que har&aacute; de tu espacio un lugar especial y &uacute;nico.</p>', 6, 19990, '', 'p0102.jpg', '', '', '', ''),
(6, 'asd12200213', 'konkret green', 16, 25000, 1, '<p>testing</p>', 1, 21990, '', 'AlbumArt.jpg', '', 'AlbumArt.jpg', '', ''),
(8, '87878', 'testeando', 16, 25000, 1, '<p>dsdasd</p>', 6, 21990, '', 'AlbumArt.jpg', 'AlbumArt.jpg', 'AlbumArt.jpg', 'AlbumArt.jpg', '');
